import React, {Component } from 'react';
import '../stylesheets/App.css';
import {BrowserRouter} from 'react-router-dom';

import {Footer, Header} from './HeaderFooter';
import HomePage from './HomePage';

class App extends Component {
  render() {
    return (
        <BrowserRouter>

        <div className="App">
            <Header />
            <HomePage/>
            <Footer />
        </div>

        </BrowserRouter>
        )
        }}


export default App;
